END;
$$;


--
-- Name: makegrid_2d(geometry, integer, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION makegrid_2d(bound_polygon geometry, grid_step integer, metric_srid integer DEFAULT 2251) RETURNS geometry
    LANGUAGE plpgsql
    AS $_$
DECLARE
  BoundM public.geometry; --Bound polygon transformed to metric projection (with metric_srid SRID)
  Xmin DOUBLE PRECISION;
  Xmax DOUBLE PRECISION;
  Ymax DOUBLE PRECISION;
  X DOUBLE PRECISION;
  Y DOUBLE PRECISION;
  points public.geometry[];
  i INTEGER;
  j INTEGER;
BEGIN
  BoundM := ST_Transform($1, $3); --From WGS84 (SRID 4326) to metric projection, to operate with step in meters
  Xmin := ST_XMin(BoundM);
  Xmax := ST_XMax(BoundM);
  Ymax := ST_YMax(BoundM);

  Y := ST_YMin(BoundM); --current sector's corner coordinate
  i := -1;
  j := 0;
  <<yloop>>
  LOOP
    IF (Y > Ymax) THEN  --Better if generating polygons exceeds bound for one step. You always can crop the result. But if not you may get not quite correct data for outbound polygons (if you calculate frequency per a sector  e.g.)
        EXIT;
    END IF;

    X := Xmin;
    <<xloop>>
    LOOP
      IF (X > Xmax) THEN
          EXIT;
      END IF;

      i := i + 1;

      -- we only want points that are inside the bound_polygon
      IF( SELECT ST_Contains( bound_polygon, ST_Transform( ST_PointFromText('POINT('||X||' '||Y||')', $3), ST_SRID($1)) ) = true ) THEN
	points[j] := ST_PointFromText('POINT('||X||' '||Y||')', $3);
	j := j + 1;
      END IF;
      
      X := X + $2;
    END LOOP xloop;
    Y := Y + $2;
  END LOOP yloop;

  RETURN ST_Transform(ST_Collect(points), ST_SRID($1));
END;
$_$;


--
-- Name: neighborhood_counts_by_point(point); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION neighborhood_counts_by_point(_test_point point) RETURNS SETOF neighborhood_counts_by_point_result
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY SELECT
    neighborhood_name,
    neighborhood_id,
    COUNT(*) total_user_polygons
  FROM whathood.user_polygon_test_point
  WHERE
    ST_Contains(polygon,_test_point)
  GROUP BY
    neighborhood_name,
    neighborhood_id
  ORDER BY total DESC;
END;
$$;


