      ) AS properties
  FROM neighborhood_polygon np
    INNER JOIN neighborhood 
      ON np.neighborhood_id = neighborhood.id 
      WHERE np.id = test_np_id ) as f ) as fc;
  RETURN geojson;
END;
$$;


