    FROM ( SELECT 'FeatureCollection' as type, array_to_json(array_agg(f)) as features
    FROM( SELECT 'Feature' as type
      , ST_AsGeoJSON( np.polygon)::json AS geometry
      , row_to_json( 
        (SELECT l FROM ( SELECT name,up.id) AS l)
      ) AS properties
  FROM neighborhood_polygon np
    INNER JOIN neighborhood 
      ON np.neighborhood_id = neighborhood.id 
      WHERE np.id = test_np_id ) as f ) as fc;
  RETURN geojson;
END;
$$;


--
-- Name: neighborhoods_geojson(integer, integer); Type: FUNCTION; Schema: whathood; Owner: -
--

CREATE FUNCTION neighborhoods_geojson(_create_event_id integer, _region_id integer) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
  geojson varchar;
BEGIN

  SELECT row_to_json( fc ) INTO geojson
    FROM ( SELECT 'FeatureCollection' as type, array_to_json(array_agg(f)) as features
    FROM( 
      SELECT 
        'Feature' as type
        , ST_AsGeoJSON( polygon )::json AS geometry
        , row_to_json( 
          (
            SELECT l FROM ( 
              SELECT 
                neighborhood.name,
                np_info.id,
                num_up
            ) AS l
          )
        ) AS properties
      FROM whathood.np_w_up_count np_info
      INNER JOIN neighborhood 
        ON neighborhood_id = neighborhood.id
      WHERE
        create_event_id = _create_event_id
        AND region_id = _region_id
    ) as f ) as fc;
    
  RETURN geojson;
END;
$$;


--
-- Name: polygon_counts(public.geometry, integer); Type: FUNCTION; Schema: whathood; Owner: -
--

CREATE FUNCTION polygon_counts(_test_point public.geometry, _neighborhood_id integer) RETURNS public.polygon_counts_result
    LANGUAGE plpgsql
    AS $$
DECLARE
  _point_as_text text;
  _test_neighborhood_name text;
  _ret_val polygon_counts_result%rowtype;
  _neighborhood_name_arr text[];
  _neighborhood_names text;
  _num_in_neighborhood integer;
  _total_user_polygons integer;
  _dominant_neighborhood_id integer;
BEGIN

  SELECT name INTO _ret_val.test_neighborhood_name FROM neighborhood WHERE id = _neighborhood_id;

  --
  --
  --
  SELECT COUNT(*) INTO _num_in_neighborhood
  FROM user_polygon up
  WHERE
    neighborhood_id = _neighborhood_id
    AND ST_Contains(up.polygon,_test_point) = 'true';

  --
  -- get the names of the neighborhoods this test point is in
  --
  SELECT
    array_agg(neighborhood_name) INTO _neighborhood_name_arr
  FROM
    whathood.user_polygon_test_point
  WHERE
    ST_Contains(polygon,_test_point);

  --
  --
  --
  SELECT COUNT(*) INTO _total_user_polygons
  FROM user_polygon up
  WHERE
    ST_Contains(up.polygon,_test_point) = 'true';

  --
  --
  --
  SELECT ST_AsText(_test_point) INTO _point_as_text;

  --
  --
  --
  SELECT whathood.get_dominant_neighborhood(_test_point)
  INTO _dominant_neighborhood_id;

  _ret_val.point_as_text        := _point_as_text;
  _ret_val.point                := _test_point;
  _ret_val.num_in_neighborhood  := _num_in_neighborhood;
  _ret_val.total_user_polygons  := _total_user_polygons;
  _ret_val.strength_of_identity := cast(_num_in_neighborhood as double precision)/cast(_total_user_polygons as double precision);
  _ret_val.neighborhood_names   := array_to_string(_neighborhood_name_arr,';');
  _ret_val.dominant_neighborhood_id := _dominant_neighborhood_id;

  RETURN _ret_val;
END;
$$;


--
-- Name: select_latest_neighborhood_polygons(integer, integer); Type: FUNCTION; Schema: whathood; Owner: -
--

CREATE FUNCTION select_latest_neighborhood_polygons(_create_event integer, test_region_id integer) RETURNS SETOF public.neighborhood_polygon
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY 
    SELECT 
      np_a.id as id,
      neighborhood.id as neighborhood_id,
      create_event_id,
      np_a.polygon as polygon,
      COUNT(trans_np_up.up_id) as num_user_polygons,
      current_timestamp as date_time_created
    FROM neighborhood_polygon np_a
    INNER JOIN trans_np_up 
      ON np_a.id = trans_np_up.np_id AND trans_np_up.create_event_id = _create_event.id
    INNER JOIN neighborhood 
      ON np_a.neighborhood_id = neighborhood.id 
    WHERE NOT EXISTS (
	SELECT * FROM neighborhood_polygon b 
	INNER JOIN neighborhood ON b.neighborhood_id = neighborhood.id 
	WHERE 
	  np_a.neighborhood_id = b.neighborhood_id 
	  AND np_a.date_time_created < b.date_time_created
	  AND neighborhood.region_id = test_region_id
    )
  GROUP BY 
    np_a.id,
    neighborhood.name,
    neighborhood.id,
    np_a.polygon,
    np_a.create_event_id
  ;
END;
$$;


--
-- Name: select_neighborhood_points(integer, integer); Type: FUNCTION; Schema: whathood; Owner: -
--

CREATE FUNCTION select_neighborhood_points(_create_event_id integer, _neighborhood_id integer) RETURNS SETOF public.select_neighborhood_points_type
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY 
    SELECT 
      x.id,
      test_point.id,
      point,
      neighborhood_id,
      x.strength_of_identity
    FROM 
      neighborhood_point_strength_of_identity x
    INNER JOIN ( 
      -- grab only the highest strength_of_identity_point
      SELECT
        test_point_id, 
        MAX(strength_of_identity) as strength_of_identity
      FROM 
        neighborhood_point_strength_of_identity
      WHERE 
        create_event_id = _create_event_id
          AND neighborhood_id = _neighborhood_id
      GROUP BY test_point_id 
    ) y
      ON x.test_point_id = y.test_point_id 
    INNER JOIN test_point 
      ON test_point.id = x.test_point_id
    WHERE 
        x.neighborhood_id = _neighborhood_id
        AND x.create_event_id = _create_event_id ;
END;
$$;


--
-- Name: select_np_up(public.neighborhood_polygons_create_event); Type: FUNCTION; Schema: whathood; Owner: -
--

CREATE FUNCTION select_np_up(_create_event public.neighborhood_polygons_create_event) RETURNS SETOF public.select_np_up_type
    LANGUAGE plpgsql
    AS $$
BEGIN

  RETURN QUERY SELECT 
    np.id as neighborhood_polygon_id, 
    user_polygon.id as up_id 
  FROM neighborhood_point_strength_of_identity
  INNER JOIN test_point 
    ON test_point.id = neighborhood_point_strength_of_identity.test_point_id
  INNER JOIN trans_ce_tp_up 
    ON trans_ce_tp_up.test_point_id = test_point.id AND trans_ce_tp_up.create_event_id = _create_event.id
  INNER JOIN user_polygon 
    ON user_polygon.id = trans_ce_tp_up.user_polygon_id
  INNER JOIN neighborhood 
    ON neighborhood.id = neighborhood_point_strength_of_identity.neighborhood_id
  INNER JOIN neighborhood_polygon np
    ON np.neighborhood_id = neighborhood.id
  WHERE 
    test_point.set_num = _create_event.test_point_meter_width
    AND np.neighborhood_id = user_polygon.neighborhood_id
  GROUP BY up_id, neighborhood_polygon_id;
  
END;
$$;


