CREATE RULE "_RETURN" AS
    ON SELECT TO np_w_up_count DO INSTEAD  SELECT np.id,
    np.neighborhood_id,
    np.create_event_id,
    np.polygon,
    np.num_user_polygons,
    np.date_time_created,
    count(trans_np_up.up_id) AS num_up
   FROM (public.neighborhood_polygon np
     JOIN public.trans_np_up ON ((trans_np_up.np_id = np.id)))
  GROUP BY np.id;


